SELECT DISTINCT JSONExtractString(labels, 'QueueName') AS queue
FROM signoz_metrics.distributed_time_series_v4_1day
WHERE metric_name = 'aws_SQS_ApproximateAgeOfOldestMessage_max' 
AND JSONExtractString(labels, 'cloud.account.id') IN {{.Account}} 
AND JSONExtractString(labels, 'cloud.region') IN {{.Region}} 
GROUP BY queue
